int
hash(const uchar *key, int len)
{
	int i;
	int pos;
	unsigned f0, f1, f2;
	const uchar *kp = key;
	int c;

	if (len < 2 || len > 34)
		return -1;

	for (i=0, f0=f1=f2=0, pos=0; pos < len; ++kp, ++pos) {
		c = tolower(*kp);
		f0 += T0[i + c];
		f1 += T1[i + c];
		f2 += T2[i + c];
		i += 256;
	}

	f0 %= 67430;
	f1 %= 67430;
	f2 %= 67430;

	return (g[f0] + g[f1] + g[f2]) % 54821;
}
